านข้อมูลเวิร์ดเพรสผิดพลาด %1$s ในการทำงาน %2$s โดย %3$s','WordPress database error %1$s for query %2$s'=>'ฐานข้อมูลเวิร์ดเพรสผิดพลาด %1$s ในการทำงาน %2$s','Taxonomy:'=>'หมวดคำศัพท์:','Select Menu:'=>'เลือกเมนู:','Site Name:'=>'ชื่อเว็บ:','Site Domain:'=>'โดเมนเว็บ:','sitename'=>'ชื่อเว็บ','Site Title:'=>'ชื่อเว็บ:','Get <em>another</em> %s site in seconds'=>'สร้างเว็บ <em>เพิ่ม</em> %s ภายในไม่กี่วินาที','Sites you are already a member of:'=>'เว็บที่คุณเป็นสมาชิก:','If you&#8217;re not going to use a great site domain, leave it for a new user. Now have at it!'=>'ถ้าคุณไม่ต้องการจะใช้ชื่อเว็บนี้เพื่อใช้งานจริง ๆ โปรดเว้นชื่อไว้ให้ผู้ใช้คนอื่น  หรือใช้งานชื่อนี้ตอนนี้','Create Site'=>'สร้างเว็บ','The site %s is yours.'=>'เว็บไซต์ %s เป็นเว็บของคุณ','Gimme a site!'=>'ให้เว็บแก่ฉัน','Congratulations! Your new site, %s, is almost ready.'=>'ยินดีด้วย! เว็บไซต์ใหม่ %s ของคุณ เกือบพร้อมใช้งานแล้ว','But, before you can start using your site, <strong>you must activate it</strong>.'=>'แต่ ก่อนที่จะคุณจะเริ่มใช้ชื่อเว็บใหม่ของคุณ <strong>คุณต้องเปิดใช้งานมัน</strong>','If you do not activate your site within two days, you will have to sign up again.'=>'หากคุณไม่ได้ยืนยันเว็บไซต์ของคุณภายในสองวัน คุณจะต้องลงทะเบียนสมัครใหม่อีกครั้ง','Site registration has been disabled.'=>'การลงทะเบียนเว็บยังไม่เปิดใช้งาน','No menus have been created yet. <a href="%s">Create some</a>.'=>'ยังไม่มีเมนูถูกสร้าง <a href="%s">สร้างเมนู</a>','Links for %s'=>'ลิงก์สำหรับ %s','This action has been disabled by the administrator.'=>'การสั่งงานนี้ถูกยกเลิกโดยผู้ดูแล','Must be at least 4 characters, letters and numbers only. It cannot be changed, so choose carefully!'=>'ต้องมีอย่างน้อย 4 ตัวอักขระ และเป็นตัวอักษรและตัวเลขเท่านั้น ไม่สามารถเปลี่ยนค่าได้ ดังนั้นกรุณาเลือกอย่างระมัดระวัง','Welcome back, %s. By filling out the form below, you can <strong>add another site to your account</strong>. There is no limit to the number of sites you can have, so create to your heart&#8217;s content, but write responsibly!'=>'ยินดีต้อนรับกลับ  %s  โดยการกรอกฟอร์มด้านล่าง  คุณจะสามารถ <strong>เพิ่มเว็บอื่นเข้าในบัญชีของคุณ</strong>  ไม่มีการจำกัดจำนวนเว็บที่คุณสามารถมีได้  ดังนั้นสร้างเนื้อหาตามที่ใจคุณต้องการ  แต่เขียนด้วยความรับผิดชอบ','If you haven&#8217;t received your email yet, there are a number of things you can do:'=>'ถ้าคุณยังไม่ได้รับอีเมลของคุณ มีวิธีการหลายอย่างที่คุณสามารถทำได้:','You must first <a href="%s">log in</a>, and then you can create a new site.'=>'คุณต้อง <a href="%s">เข้าสู่ระบบ</a> ก่อน  แล้วคุณถึงสามารถสร้างเว็บใหม่','You are logged in already. No need to register again!'=>'คุณได้เข้าสู่ระบบแล้ว  ไม่มีความจำเป็นที่ต้องลงทะเบียนอีก','<strong>Error</strong>: This username is invalid because it uses illegal characters. Please enter a valid username.'=>'<strong>ผิดพลาด</strong>: ชื่อผู้ใช้นี้ไม่สามารถใช้งานได้เพราะใช้ตัวอักษรที่ผิดกฎ โปรดใส่ชื่อผู้ใช้ที่ใช้งานได้','We send your registration email to this address. (Double-check your email address before continuing.)'=>'เราส่งอีเมลลงทะเบียนของคุณไปที่นี่ (กรุณาเช็คอีเมลของคุณอีกครั้งก่อนดำเนินการต่อ)','Wait a little longer. Sometimes delivery of email can be delayed by processes outside of our control.'=>'รอต่ออีกหน่อย  บางทีการสงอีเมลอาจช้าเพราะการทำงานบางอย่างที่นอกเหนือการควบคุมของเรา','Check the junk or spam folder of your email client. Sometime emails wind up there by mistake.'=>'กรุณาตรวจสอบโฟลเดอร์ถังขยะ หรือโฟลเดอร์สแปม ในโปรแกรมรับส่งอีเมลของคุณ บางครั้งอีเมลอาจถูกเก็บเข้าไปอยู่ที่นั่นโดยไม่ได้ตั้งใจ','Sorry, new registrations are not allowed at this time.'=>'เสียใจด้วย  ยังไม่อนุญาตการลงทะเบียนใหม่ในขณะนี้','User'=>'ผู้ใช้','If this was a mistake, ignore this email and nothing will happen.'=>'หากคุณไม่ได้ตั้งใจเปลี่ยนรหัสผ่าน ให้ลบอีเมลนี้ได้เลย จะไม่มีผลใดๆ ต่อบัญชีของคุณ','To reset your password, visit the following address:'=>'เพื่อตั้งค่ารหัสผ่านใหม่ของคุณ  คุณต้องเข้าที่ลิงก์ต่อไปนี้','Password Reset'=>'ล้างค่ารหัสผ่าน','Your password has been reset.'=>'รหัสผ่านของคุณถูกตั้งค่าแล้ว','Reset Password'=>'ล้างค่ารหัสผ่าน','New password'=>'รหัสผ่านใหม่','Confirm new password'=>'ยืนยันรหัสผ่านใหม่','Display as dropdown'=>'แสดงผลแบบ drop down','domain'=>'โดเมน','Your address will be %s.'=>'ที่อยู่ของคุณจะเป็น %s','links widgetAll Links'=>'ลิงก์ทั้งหมด','%1$s is your new site. <a href="%2$s">Log in</a> as &#8220;%3$s&#8221; using your existing password.'=>'%1$s คือเว็บไซต์ใหม่ของคุณ <a href="%2$s">เข้าสู่ระบบ</a> ด้วย &#8220;%3$s&#8221; และใช้รหัสผ่านของคุณที่มีอยู่','You can create a %s file through a web interface, but this doesn\'t work for all server setups. The safest way is to manually create the file.'=>'คุณสามารถสร้างไฟล์ %s ผ่านทางหน้าเว็บ  แต่วิธีนี้ไม่สามารถใช้ได้กับเซิร์ฟเวอร์ทุกประเภท  วิธีที่ดีที่สุดคือการสร้างไฟล์ด้วยตัวเอง','Create a Configuration File'=>'สร้างไฟล์สำหรับกำหนดค่า (Configuration file)','Allow search engines to index this site.'=>'อนุญาตให้โปรแกรมช่วยสืบค้นข้อมูลจัดทำดรรชนีของเว็บนี้','Link title'=>'ชื่อลิงก์','Link rating'=>'จัดอันดับลิงก์','Link ID'=>'เลขที่ลิงก์','Number of links to show:'=>'จำนวนลิงก์ที่จะแสดง','Select Link Category:'=>'เลือกหมวดหมู่ลิงก์','Upload'=>'อัปโหลด','Display post date?'=>'แสดงวันที่ของเรื่อง?','<strong>Error</strong>: This username is already registered. Please choose another one.'=>'<strong>ผิดพลาด</strong>: ชื่อผู้ใช้นี้ถูกใช้ลงทะเบียนแล้ว โปรดเลือกชื่ออื่น','Links widgetRandom'=>'สุ่ม','Have you entered your email correctly? You have entered %s, if it&#8217;s incorrect, you will not receive your email.'=>'คุณใส่อีเมลของคุณถูกต้องหรือไม่  ที่คุณใส่คือ %s  ถ้ามันไม่ถูกต้อง  คุณจะไม่ได้รับอีเมลของคุณ','The site you were looking for, %s, does not exist, but you can create it now!'=>'เว็บที่คุณค้นหาสำหรับ %s นั้นไม่มีอยู่จริง  แต่คุณสามารถสร้างมันได้เดี๋ยวนี้','<strong>Error</strong>: Couldn&#8217;t register you&hellip; please contact the <a href="mailto:%s">site admin</a>!'=>'<strong>ผิดพลาด</strong>: ไม่สามารถลงทะเบียนคุณได้&hellip; โปรดติดต่อ <a href="mailto:%s">เว็บมาสเตอร์</a> !','A list of your site&#8217;s Pages.'=>'รายชื่อหน้าของเว็บของคุณ','A search form for your site.'=>'แบบฟอร์มการค้นหาสำหรับเว็บของคุณ','A monthly archive of your site&#8217;s Posts.'=>'คลังเก็บรายเดือนของเรื่องบนเว็บของคุณ','Login, RSS, &amp; WordPress.org links.'=>'เข้าสู่ระบบ, RSS, &amp; WordPress.org ลิงก์','A list or dropdown of categories.'=>'รายชื่อหรือดรอปดาวน์ของหมวดหมู่','Your site&#8217;s most recent Posts.'=>'เรื่องล่าสุดของเว็บไซต์ของคุณ','Your site&#8217;s most recent comments.'=>'ความเห็นล่าสุดของเว็บคุณ','Entries from any RSS or Atom feed.'=>'เรื่องจาก RSS ใด ๆ หรือ Atom ฟีด','A cloud of your most used tags.'=>'กลุ่มป้ายกำกับที่คุณใช้บ่อยที่สุด','Block'=>'บล็อก','Tools'=>'เครื่องมือ','Search widgetSearch'=>'ค้นหา','The query argument of %s must have a placeholder.'=>'อาร์กิวเมนต์การสืบค้นของ %s ต้องมีข้อความตัวอย่าง','<strong>Error</strong>: Cookies are blocked due to unexpected output. For help, please see <a href="%1$s">this documentation</a> or try the <a href="%2$s">support forums</a>.'=>'<strong>ผิดพลาด</strong>: Cookie ถูกปิดกั้นเนื่องจากผลลัพธ์ที่ไม่คาดคิด สำหรับความช่วยเหลือในเรื่องนี้ โปรดดูที่ <a href="%1$s">คู่มือนี้</a> หรือลองไปที่ <a href="%2$s">ฟอรั่มสนับสนุน</a>','<strong>Error</strong>: Cookies are blocked or not supported by your browser. You must <a href="%s">enable cookies</a> to use WordPress.'=>'<strong>ผิดพลาด</strong>: Cookie ถูกปิดกั้นหรือเบราว์เซอร์ของคุณไม่สนับสนุน คุณต้อง <a href="%s">เปิดใช้งาน cookie</a> เพื่อใช้งาน WordPress','%s must set a database connection for use with escaping.'=>'%s ต้องตั้งค่าการเชื่อมต่อฐานข้อมูลสำหรับใช้กับการออก','No %1$s was set in the arguments array for the "%2$s" sidebar. Defaulting to "%3$s". Manually set the %1$s to "%3$s" to silence this notice and keep existing sidebar content.'=>'ไม่มีการตั้ง %1$s ในค่ากลุ่มตัวตัวแปร (arguments array) สำหรับแถบด้านข้าง "%2$s" ค่าเริ่มต้นที่ "%3$s" ตั้งค่า %1$s ด้วยตัวเองไปที่ "%3$s" เพื่อปิดเสียงคำเตือนนี้และยังคงเนื้อหาในแถบด้านข้างที่มีอยู่','Content:'=>'เนื้อหา:','Registration confirmation will be emailed to you.'=>'การยืนยันการลงทะเบียนจะถูกส่งไปที่อีเมลของคุณ','Show password'=>'แสดงรหัสผ่าน','Hide password'=>'ซ่อนรหัสผ่าน','The tag cloud will not be displayed since there are no taxonomies that support the tag cloud widget.'=>'tag cloud ไม่สามารถแสดงได้ตั้งแต่ไม่มีลำดับขั้นที่สนับสนุนวิดเจ็ต tag cloud ','Can&#8217;t select database'=>'ไม่สามารถเลือกฐานข้อมูล','We were able to connect to the database server (which means your username and password is okay) but not able to select the %s database.'=>'เราสามารถเชื่อมต่อกับฐานข้อมูลเซิร์ฟเวอร์ (นั่นแสดงว่าชื่อผู้ใช้และรหัสผ่านของคุณถูกต้อง) แต่ไม่สามารถเลือก %s ฐานข้อมูลได้','Are you sure it exists?'=>'คุณแน่ใจว่าสิ่งนี้มีจริง?','Does the user %1$s have permission to use the %2$s database?'=>'ผู้ใช้ %1$s มีสิทธิใช้ฐานข้อมูล %2$s หรือไม่?','On some systems the name of your database is prefixed with your username, so it would be like <code>username_%1$s</code>. Could that be the problem?'=>'บนบางระบบ ชื่อฐานข้อมูลของคุณขึ้นต้นด้วยชื่อผู้ใช้ของคุณ  ดังนั้นชื่อฐานข้อมูลจะเป็น<code>ชื่อผู้ใช้_%1$s</code> สิ่งนี้เป็นปัญหาของคุณหรือเปล่า?','If you don&#8217;t know how to set up a database you should <strong>contact your host</strong>. If all else fails you may find help at the <a href="%s">WordPress Support Forums</a>.'=>'ถ้าคุณไม่รู้วิธียังค่าฐานข้อมูล คุณควรจะ <strong>ติดต่อโฮสท์ของคุณ</strong> ถ้ามีบางอย่างล้มเหลว คุณอาจจะลองค้นหาความช่วยเหลือที่ <a href="%s">ฟอรั่มสนับสนุนเวิร์ดเพรส</a>','This either means that the username and password information in your %1$s file is incorrect or we can&#8217;t contact the database server at %2$s. This could mean your host&#8217;s database server is down.'=>'นี่อาจหมายถึงชื่อผู้ใช้และรหัสผ่านในไฟล์ %1$s ของคุณไม่ถูกต้องหรือเราไม่สามารถเชื่อมต่อกับฐานข้อมูลเซิร์ฟเวอร์ที่ %2$s  ซึ่งอาจจะหมายถึงฐานข้อมูลเซิร์ฟเวอร์โฮสท์ของคุณใช้งานไม่ได้ตอนนี้ ','Are you sure you have the correct username and password?'=>'คุณแน่ใจหรือไม่ว่ามีชื่อผู้ใช้และรหัสผ่านที่ถูกต้อง?','Are you sure you have typed the correct hostname?'=>'คุณมั่นใจหรือไม่ว่าได้กรอกชื่อโฮสต์ (hostname) ถูกต้อง?','Are you sure the database server is running?'=>'คุณแน่ใจหรือไม่ว่าฐานข้อมูลเซิร์ฟเวอร์ทำงานเป็นปกติ?','If you&#8217;re unsure what these terms mean you should probably contact your host. If you still need help you can always visit the <a href="%s">WordPress Support Forums</a>.'=>'ถ้าคุณไม่แน่ใจว่าเงื่อนไขเหล่านี้หมายถึงอะไร คุณอาจจะติดต่อโฮสท์ของคุณ  ถ้าคุณยังต้องการความช่วยเหลืออีก  คุณสามารถเยี่ยมชม <a href="%s">ฟอรั่มสนับสนุนเวิร์ดเพรส</a> ได้เสมอ','Error reconnecting to the database'=>'มีความผิดพลาดในการเชื่อมต่ออีกครั้งไปยังฐานข้อมูล','This means that we lost contact with the database server at %s. This could mean your host&#8217;s database server is down.'=>'นี่หมายถึงเราเสียการติดต่อกับฐานข้อมูลเซิร์ฟเวอร์ที่ %s  ซึ่งอาจจะหมายถึงฐานข้อมูลเซิร์ฟเวอร์โฮสท์ของคุณใช้งานไม่ได้ตอนนี้','Are you sure the database server is not under particularly heavy load?'=>'คุณแน่ใจหรือไม่ว่าฐานข้อมูลเซิร์ฟเวอร์ไม่ได้ทำงานหนัก?','Author:'=>'ผู้เขียน:','Posted title:'=>'หัวข้อเรื่อง:','Mission complete. Message %s deleted.'=>'ภารกิจสำเร็จ  ลบข้อความ %s แล้ว','Site Language:'=>'ภาษาเว็บ:','The site you were looking for, %s, does not exist.'=>'เว็บ %s ที่คุณกำลังหาไม่มีอยู่จริง','Check your inbox at %s and click the link given.'=>'ตรวจกล่องเมลขาเข้า %s และกดที่ลิงก์ที่ได้รับ','There doesn\'t seem to be a %s file. I need this before we can get started.'=>'นี่เหมือนไม่ใช่ไฟล์ %s เราต้องการไฟล์นี้ก่อนที่จะเริ่มการทำงาน','Need more help? <a href=\'%s\'>We got it</a>.'=>'ต้องการความช่วยเหลือ? <a href=\'%s\'>เรามีให้คุณ</a>','<strong>Error</strong>: Sorry, that username is not allowed.'=>'<strong>ผิดพลาด</strong>: ขออภัย ไม่อนุญาตให้ใช้ชื่อผู้ใช้นั้น','Your session has expired. Please log in to continue where you left off.'=>'ช่วงเวลาของคุณหมดอายุแล้ว กรุณาเข้าสู่ระบบเพื่อทำต่อจากก่อนหน้า','Confirm use of weak password'=>'ยืนยันการใช้งานรหัสผ่านที่ไม่ปลอดภัย','Unable to retrieve the error message from MySQL'=>'ไม่สามารถกู้ข้อความผิดพลาดจาก MySQL','site&larr; Go to %s'=>'&larr; กลับไปที่ %s','I really need an ID for this to work.'=>'ฉันต้องการเลขที่ไอดีจริง ๆ สำหรับสิ่งนี้เพื่อทำงาน','Sorry, trackbacks are closed for this item.'=>'ขออภัย trackbacks ถูกปิดสำหรับรายการนี้','We already have a ping from that URL for this post.'=>'เรามีการ ping จาก URL นั้นแล้วสำหรับเรื่องนี้','Displays an audio player.'=>'แสดงตัวเล่นเสียง','label for button in the audio widget; should preferably not be longer than ~13 characters longReplace Audio'=>'เปลี่ยนไฟล์เสียง','label for button in the audio widget; should preferably not be longer than ~13 characters longEdit Audio'=>'แก้ไขไฟล์เสียง','We can&#8217;t find that audio file. Check your <a href="%s">media library</a> and make sure it wasn&#8217;t deleted.'=>'เราไม่พบไฟล์เสียงดังกล่าว กรุณาไปที่<a href="%s">คลังสื่อ</a> และตรวจสอบว่าไฟล์ไม่ได้ถูกลบไปแล้ว','Audio Widget (%d)'=>'วิดเจ็ตเสียง (%d)','Audio Widget'=>'วิดเจ็ตเสียง','Looks like this isn&#8217;t the correct kind of file. Please link to an audio file instead.'=>'ดูเหมือนว่านามสกุลของไฟล์ที่เลือกไม่ถูกต้อง กรุณาเลือกไฟล์เสียงใหม่','URL to the %s audio source file'=>'URL ไปยังไฟล์เสียงของ %s','Unable to preview media due to an unknown error.'=>'พบข้อผิดพลาดโดยไม่ทราบสาเหตุ ทำให้ไม่สามารถแสดงตัวอย่างมีเดียได้','Displays an image.'=>'แสดงรูปภาพ','label for button in the gallery widget; should not be longer than ~13 characters longEdit Gallery'=>'แก้ไขคลังรูป','label for button in the image widget; should preferably not be longer than ~13 characters longReplace Image'=>'เปลี่ยนรูปภาพ','label for button in the image widget; should preferably not be longer than ~13 characters longEdit Image'=>'แก้ไขรูปภาพ','We can&#8217;t find that image. Check your <a href="%s">media library</a> and make sure it wasn&#8217;t deleted.'=>'เราไม่พบไฟล์รูปภาพดังกล่าว กรุณาไปยัง<a href="%s">คลังสื่อ</a> และตรวจสอบว่าไฟล์ยังไม่ถูกลบ','Image Widget (%d)'=>'วิดเจ็ตภาพ (%d)','Image Widget'=>'วิดเจ็ตภาพ','Displays a video from the media library or from YouTube, Vimeo, or another provider.'=>'แสดงวิดีโอจากคลังสื่อหรือจากยูทูบ, วิมีโอ, หรือผู้ให้บริการอื่นๆ','label for button in the gallery widget; should not be longer than ~13 characters longAdd Images'=>'เพิ่มรูปภาพ','label for button in the video widget; should preferably not be longer than ~13 characters longReplace Video'=>'เปลี่ยนวิดีโอ','label for button in the video widget; should preferably not be longer than ~13 characters longEdit Video'=>'แก้ไขวิดีโอ','We can&#8217;t find that video. Check your <a href="%s">media library</a> and make sure it wasn&#8217;t deleted.'=>'เราไม่พบวิดีโอดังกล่าว กรุณาไปยัง<a href="%s">คลังสื่อ</a> และตรวจสอบว่าไฟล์ยังไม่ถูกลบ','Video Widget (%d)'=>'วิดเจ็ตวิดีโอ (%d)','Video Widget'=>'วิดเจ็ตวิดีโอ','URL to the %s video source file'=>'URL ไปยังวิดีโอของ %s','A media item.'=>'ไฟล์สื่อ','No media selected'=>'ยังไม่มีการเลือกไฟล์สื่อ','label for button in the media widget; should preferably not be longer than ~13 characters longReplace Media'=>'เปลี่ยนสื่อ','label for button in the media widget; should preferably not be longer than ~13 characters longEdit Media'=>'แก้ไขสื่อ','Add to Widget'=>'เพิ่มไปยังวิดเจ็ต','We can&#8217;t find that file. Check your <a href="%s">media library</a> and make sure it wasn&#8217;t deleted.'=>'เราไม่พบไฟล์ดังกล่าว แนะนำให้ลองเช็คที่ <a href="%s">คลังไฟล์สื่อ</a> ว่าไฟล์ถูกลบไปหรือไม่','Media Widget (%d)'=>'วิดเจ็ตสื่อ (%d)','Media Widget'=>'วิดเจ็ตสื่อ','Looks like this isn&#8217;t the correct kind of file. Please link to an appropriate file instead.'=>'ดูเหมือนว่านามสกุลของไฟล์ที่เลือกไม่ถูกต้อง กรุณาเลือกไฟล์ใหม่','Attachment post ID'=>'ID ของเรื่องที่แนบไฟล์','URL to the media file'=>'URL ของไฟล์สื่อ','Title for the widget'=>'หัวข้อสำหรับวิดเจ็ต','Greetings Network Administrator!'=>'ขอต้อนรับผู้ดูแลเครือข่าย!','The network currently disallows registrations.'=>'ระบบไม่อนุญาตให้ลงทะเบียน','The network currently allows site registrations.'=>'ระบบอนุญาตให้ลงทะเบียนเฉพาะเว็บใหม่','The network currently allows user registrations.'=>'ระบบอนุญาตให้ลงทะเบียนเฉพาะผู้ใช้ใหม่','The network currently allows both site and user registrations.'=>'ระบบอนุญาตให้ลงทะเบียนทั้งเว็บใหม่และผู้ใช้ใหม่','To change or disable registration go to your <a href="%s">Options page</a>.'=>'ไปที่ <a href="%s">Options page</a> เพื่อเปลี่ยนแปลง หรือปิดรับการสมัครสมาชิก','label for button in the audio widgetAdd Audio'=>'เพื่อไฟล์เสียง','label for button in the image widgetAdd Image'=>'เพิ่มรูปภาพ','label for button in the video widgetAdd Video'=>'เพิ่มไฟล์วิดีโอ','label for button in the media widgetAdd Media'=>'เพิ่มไฟล์สื่อ','Show tag counts'=>'แสดงจำนวนแท็ก','Arbitrary HTML code.'=>'เนื้อหา HTML ที่ต้องการ','Custom HTML'=>'เนื้อหา HTML','Some HTML tags are not permitted, including:'=>'แท็ก HTML เหล่านี้ไม่อนุญาตให้ใช้:','Arbitrary text.'=>'ข้อความที่ต้องการ','This widget may contain code that may work better in the &#8220;Custom HTML&#8221; widget. How about trying that widget instead?'=>'วิดเจ็ตนี้อาจมีโค้ด ที่อาจจะทำงานได้ดีกว่าบนวิดเจ็ต "HTML แบบกำหนดเอง" สนใจใช้วิดเจ็ตนั้นแทนหรือเปล่า?','New Custom HTML Widget'=>'วิดเจ็ตเนื้อหา HTML ใหม่','Did you just paste HTML?'=>'คุณเพิ่งวางเนื้อหา HTML หรือเปล่า?','This widget may have contained code that may work better in the &#8220;Custom HTML&#8221; widget. If you haven&#8217;t yet, how about trying that widget instead?'=>'วิดเจ็ตนี้อาจมีโค้ดที่อาจจะทำงานได้ดีกว่าในวิดเจ็ต "HTML ที่กำหนดเอง" สนใจใช้วิดเจ็ตนั้นแทนหรือเปล่า?','Did you know there is a &#8220;Custom HTML&#8221; widget now? You can find it by pressing the &#8220;<a class="add-widget" href="#">Add a Widget</a>&#8221; button and searching for &#8220;HTML&#8221;. Check it out to add some custom code to your site!'=>'เฮ้! คุณรู้หรือยังว่าตอนนี้เรามีวิดเจ็ต "HTML แบบกำหนดเอง" แล้วนะ ลองใช้ได้ทันทีด้วยการกดปุ่ม &#8220;<a class="add-widget" href="#">เพิ่มวิดเจ็ต</a>&#8221; และมองหาคำว่า &#8220;HTML&#8221; 