้าถึง API ได้','Sorry, you are not allowed to upload media on this site.'=>'ขออภัย คุณไม่ได้รับอนุญาตให้อัปโหลดไฟล์สื่อบนเว็บนี้','Sorry, you are not allowed to upload media to this post.'=>'ขออภัย คุณไม่ได้รับอนุญาตให้อัปโหลดไฟล์สื่อมาที่เรื่องนี้','Invalid parent type.'=>'ประเภทหลักไม่ถูกต้อง','Alternative text to display when attachment is not displayed.'=>'ข้อความทางเลือกที่จะแสดงเมื่อไฟล์แนบแสดงไม่ได้','Details about the media file, specific to its type.'=>'รายละเอียดเกี่ยวกับไฟล์สื่อ, กำหนดประเภทของสื่อ','The ID for the associated post of the attachment.'=>'เลขที่เรื่องที่เกี่ยวข้องของไฟล์แนบ','No data supplied.'=>'ไม่มีข้อมูลไว้ให้','No Content-Type supplied.'=>'ไม่มีContent-Type ให้','No Content-Disposition supplied.'=>'ไม่มีContent-Disposition ให้','Invalid Content-Disposition supplied. Content-Disposition needs to be formatted as `attachment; filename="image.png"` or similar.'=>'โค้ดในส่วน Content-Disposition ที่ใช้มีความผิดพลาด รูปแบบที่ถูกต้องควรเป็น `attachment; filename="image.png"` หรือเขียนคล้ายๆ กัน','Content hash did not match expected.'=>'ค่า hash ไม่ถูกต้อง','Could not open file handle.'=>'ไม่สามารถเปิดตัวจัดการไฟล์','Limit result set to attachments of a particular media type.'=>'ผลลัพท์จำกัดที่ตั้งไว้ให้ไฟล์แนบของ ประเภทสื่อเฉพาะ','Limit result set to attachments of a particular MIME type.'=>'ผลลัพท์จำกัดที่ตั้งไว้ให้ไฟล์แนบของ ประเภท MIME เฉพาะ','Whether to bypass Trash and force deletion.'=>'ไม่ต้องทิ้งลงถังขยะและบังคับลบโดยทันที','Query parameter not permitted: %s'=>'ไม่อนุญาตให้ใช้พารามิเตอร์ %s ในการคิวรี่','Cannot create existing comment.'=>'ไม่สามารถเขียนความเห็นที่มีอยู่','Creating a comment requires valid author name and email values.'=>'การเขียนความเห็นต้องมีชื่อผู้เขียนและอีเมลที่ใช้งานได้','Creating comment failed.'=>'การสร้างความเห็นล้มเหลว','Updating comment status failed.'=>'การอัปเดตสถานะความเห็นล้มเหลว','Updating comment failed.'=>'การอัปเดตความเห็นล้มเหลว','The comment has already been trashed.'=>'ความเห็นถูกย้ายไปถังขยะแล้ว','The comment cannot be deleted.'=>'ไม่สามารถลบความเห็นได้','Invalid comment author ID.'=>'ความเห็นไม่ถูกต้อง  เลขที่ผู้เขียน','Unique identifier for the object.'=>'ตัวบ่งชี้เฉพาะสำหรับ object','The ID of the user object, if author was a user.'=>'เลขที่ของผู้ใช้ object ถ้าผู้เขียนเป็นผู้ใช้','Email address for the comment author.'=>'ที่อยู่อีเมลของผู้เขียนความเห็น','IP address for the comment author.'=>'หมายเลขไอพีของผู้เขียนความเห็น','Display name for the comment author.'=>'ชื่อที่แสดงของผู้เขียนความเห็น','URL for the comment author.'=>'URL ของผู้เขียนความเห็น','User agent for the comment author.'=>'User agent ของผู้เขียนความเห็น','The content for the post.'=>'เนื้อหาของเรื่อง','Content for the post, as it exists in the database.'=>'เนื้อหาของเรื่อง ตามที่ปรากฏอยู่ในฐานข้อมูล','HTML content for the post, transformed for display.'=>'เนื้อหาแบบ HTML ของเรื่อง ที่ประมวลผลสำหรับแสดงผลแล้ว','The date the post was published, as GMT.'=>'วันที่เรื่องเผยแพร่ ตามเวลา GMT','URL to the object.'=>'URL ของ object','The ID for the parent of the post.'=>'เลขที่ ID ของเรื่องหลัก','The ID of the associated post object.'=>'ID ของโพสต์ที่กำหนด','State of the comment.'=>'สถานะของความเห็น','Avatar URL with image size of %d pixels.'=>'URL รูปประจำตัวขนาด %d พิกเซล','Avatar URLs for the comment author.'=>'URL รูปประจำตัวของผู้เขียนความเห็น','Limit response to posts published after a given ISO8601 compliant date.'=>'จำกัดการแสดงความเห็นสำหรับโพสต์ที่เผยแพร่หลังจากวันที่ที่ระบุ (รูปแบบวันที่มาตรฐาน ISO8601)','Limit result set to comments assigned to specific user IDs. Requires authorization.'=>'ตั้งการจำกัดผลลัพธ์ของคอมเมนต์ที่ถูกระบุเฉพาะเจาะจงไปไอดีผู้ใช้ ต้องการการได้รับอนุญาต','Ensure result set excludes comments assigned to specific user IDs. Requires authorization.'=>'ทำให้มั่นใจว่าผลลัพธ์นั้นไม่รวมคอมเมนต์ที่ถูกระบุเฉพาะเจาะจงไปที่ไอดีของผู้ใช้กลุ่มใดกลุ่มหนึ่ง ต้องการการได้รับอนุญาต','Limit result set to that from a specific author email. Requires authorization.'=>'จำกัดชุดผลลัพธ์เฉพาะอีเมลผู้เขียนที่กำหนด ต้องได้รับการอนุญาตเพื่อดำเนินการ','Limit response to posts published before a given ISO8601 compliant date.'=>'จำกัดการแสดงความเห็นสำหรับโพสต์ที่เผยแพร่ก่อนวันที่ที่ระบุ (รูปแบบวันที่มาตรฐาน ISO8601)','Ensure result set excludes specific IDs.'=>'ระบุ IDs ที่ไม่ต้องการให้อยู่ชุดผลลัพธ์','Limit result set to specific IDs.'=>'จำกัดผลลัพธ์เฉพาะตาม ID ที่กำหนด','Order sort attribute ascending or descending.'=>'เรียงลำดับจากน้อยไปมาก หรือมากไปน้อย','Sort collection by object attribute.'=>'เรียงลำดับตามแอททริบิสต์ของออบเจ็กท์','Limit result set to comments of specific parent IDs.'=>'จำกัดผลลัพธ์เฉพาะคอมเมนต์ใต้ ID ที่กำหนด','Ensure result set excludes specific parent IDs.'=>'ยืนยันว่า ID ของเนื้อหาแม่จะไม่ถูกรวมมาในผลลัพธ์','Limit result set to comments assigned to specific post IDs.'=>'จำกัดผลการค้นหาความคิดเห็น ที่ถูกกำหนดโดยไอดีเฉพาะเจาะจง','Limit result set to comments assigned a specific status. Requires authorization.'=>'จำกัดผลการค้นหาความคิดเห็น ที่ถูกกำหนดโดยสถานะที่ได้รับอนุญาต','Limit result set to comments assigned a specific type. Requires authorization.'=>'จำกัดผลการค้นหาความคิดเห็น ที่ถูกกำหนดประเภทที่ได้รับอนุญาต','Method \'%s\' not implemented. Must be overridden in subclass.'=>'ไม่พบเมท็อด \'%s\', จำเป็นต้องถูกเขียนทับโดยซับคลาส','Current page of the collection.'=>'หน้าปัจจุบันของชุด','Maximum number of items to be returned in result set.'=>'จำนวนสูงสุดของรายการที่จะถูกคืนค่าในชุดผลลัพท์','Limit results to those matching a string.'=>'จำกัดผลลัพท์ไปยังคำที่ตรงกับการจับคู่','Scope under which the request is made; determines fields present in response.'=>'ขอบเขตได้ถูกกำหนดตามการร้องขอ; กำหนดฟิลด์เพื่อตอบสนอง','Whether posts with this status should be private.'=>'ถ้าเรื่องที่อยู่ในสถานะนี้ควรจะตั้งค่าเป็นส่วนตัว','Whether posts with this status should be protected.'=>'ถ้าเรื่องที่อยู่ในสถานะนี้ควรจะถูกป้องกัน','Whether posts of this status should be shown in the front end of the site.'=>'ถ้าเรื่องของสถานะนี้ควรจะแสดงในด้านหน้าของเว็บ','Whether posts with this status should be publicly-queryable.'=>'เรื่องสามารถค้นหาสืบค้นอย่างสาธารณะได้เสมอ','Whether to include posts in the edit listing for their post type.'=>'ถ้ารวมเรื่องในรายชื่อแก้ไขสำหรับประเภทเรื่องของพวกมัน','An alphanumeric identifier for the user.'=>'ค่าตัวแปรในรูปแบบตัวอักษรและตัวเลขสำหรับผู้ใช้','Sorry, you are not allowed to manage post statuses.'=>'ขออภัย คุณไม่ได้รับอนุญาตให้จัดการกับสถานะของเรื่อง','All capabilities used by the taxonomy.'=>'ความสามารถทั้งหมดที่ถูกใช้ได้โดยหมวดคำศัพท์','A human-readable description of the taxonomy.'=>'คำอธิบายที่คนอ่านได้ของหมวดคำศัพท์','Whether or not the taxonomy should have children.'=>'เมื่อไรที่ควรจะให้หมวดคำศัพท์มีหมวดลูก','Human-readable labels for the taxonomy for various contexts.'=>'ป้ายชื่อที่คนอ่านได้สำหรับหมวดคำศัพท์ในบริบทต่างๆ กัน','The password for the post if it is password protected.'=>'รหัสผ่านของเรื่องที่มีการตั้งรหัสผ่านป้องกัน','You need to define a search term to order by relevance.'=>'คุณต้องกำหนดลำดับของเงื่อนไขการค้นหา เป็นแบบตามความสัมพันธ์','Incorrect post password.'=>'รหัสเรื่องไม่ถูกต้อง','Sorry, you are not allowed to create new users.'=>'ขออภัย คุณไม่ได้รับอนุญาตให้สร้างผู้ใช้ใหม่','Cannot create existing post.'=>'ไม่สามารถสร้างเรื่องที่มีอยู่','Sorry, you are not allowed to manage this plugin.'=>'ขออภัย คุณไม่ได้รับอนุญาตให้จัดการปลั๊กอินนี้','Sorry, you are not allowed to edit comments.'=>'ขออภัย คุณไม่ได้รับอนุญาตให้แก้ไขความเห็น','The post has already been deleted.'=>'เรื่องถูกลบเรียบร้อยแล้ว','A post can not be sticky and have a password.'=>'เรื่องไม่สามารถปักหมุด และตั้งรหัสผ่านได้','A sticky post can not be password protected.'=>'เรื่องแบบปักหมุด ไม่สามารถเปิดใช้งานรหัสผ่านป้องกันได้','A password protected post can not be set to sticky.'=>'เรื่องแบบมีรหัสผ่านป้องกัน ไม่สามารถปักหมุดได้','Invalid post parent ID.'=>'เลขที่เรื่องหลักไม่ถูกต้อง','Invalid featured media ID.'=>'เลขที่เฉพาะของไฟล์สื่อพิเศษไม่ถูกต้อง','The date the revision was published, in the site\'s timezone.'=>'วันและเวลาของสำเนาการแก้ไขเผยแพร่ตามเขตเวลาของเว็บ','The date the revision was published, as GMT.'=>'วันและเวลาของสำเนาการแก้ไขเผยแพร่ตามเเวลามาตรฐานกรีนิช (GMT)','The globally unique identifier for the post.'=>'globally unique ของเรื่อง','GUID for the revision, as it exists in the database.'=>'GUID สำหรับสำเนาการแก้ไข ตามที่ปรากฎในฐานข้อมูล','GUID for the post, transformed for display.'=>'แปลง GUID ของเรื่องให้แสดงผลได้','The date the revision was last modified, in the site\'s timezone.'=>'วันที่ที่สำเนาการแก้ไขถูกแก้ไขครั้งสุดท้าย ตามเขตเวลาของเว็บ','The date the revision was last modified, as GMT.'=>'วันที่ที่สำเนาการแก้ไขถูกแก้ไขครั้งสุดท้าย ตามเวลา GMT','An alphanumeric identifier for the revision unique to its type.'=>'ค่าตัวแปรในรูปแบบตัวอักษรและตัวเลขซึ่งเป็นค่าโดยเฉพาะสำหรับสำเนาการแก้ไข','A named status for the post.'=>'ชื่อสถานะสำหรับเรื่อง','The title for the object.'=>'หัวข้อของเนื้อหา','Title for the post, as it exists in the database.'=>'ชื่อสำหรับเรื่องตามที่ปรากฎอยู่ในฐานข้อมูล','HTML title for the post, transformed for display.'=>'ชื่อ HTML สำหรับเรื่อง ปรับแต่งสำหรับการแสดงผล','Whether the content is protected with a password.'=>'เนื้อหาถูกป้องกันด้วยรหัสผ่านหรือไม่','The ID for the author of the post.'=>'ID สำหรับผู้เขียนของเรื่อง','The excerpt for the post.'=>'เกริ่นนำสำหรับเรื่อง','Excerpt for the post, as it exists in the database.'=>'เกริ่นนำสำหรับเรื่องตามที่ปรากฎอยู่ในฐานข้อมูล','HTML excerpt for the post, transformed for display.'=>'เกริ่นนำ HTML สำหรับเรื่อง ปรับแต่งสำหรับการแสดงผล','Whether the excerpt is protected with a password.'=>'ถึงแม้ว่าเกริ่นนำจะถูกป้องกันด้วยรหัสผ่านหรือไม่','The ID of the featured media for the post.'=>'ไอดีของไฟล์สื่อพิเศษสำหรับเรื่อง','Whether or not comments are open on the post.'=>'เมื่อไรที่จะเปิดให้แสดงความเห็นสำหรับเรื่องได้','Whether or not the post can be pinged.'=>'เมื่อไรที่เรื่องสามารถที่จะถูกอ้างถึง','The format for the post.'=>'รูปแบบสำหรับเรื่อง','Whether or not the post should be treated as sticky.'=>'เมื่อไรที่เรื่องควรจะถูกปักหมุด','A password to protect access to the content and excerpt.'=>'รหัสผ่านเพื่อป้องกันการเข้าถึงเนื้อหาและเกริ่นนำ','The theme file to use to display the post.'=>'ไฟล์ธีมที่ใช้ในการแสดงผลเรื่อง','The terms assigned to the post in the %s taxonomy.'=>'คำศัพท์ถูกกำหนดให้กับเรื่องในหมวดคำศัพท์ %s','Limit result set to posts assigned to specific authors.'=>'จำกัดผลลัพท์ตั้งค่าไปที่เรื่องที่มอบหมายให้กับผู้เขียนที่เจาะจง','Ensure result set excludes posts assigned to specific authors.'=>'มั่นใจว่าผลลัพท์จะตั้งค่าไม่รวมเรื่องที่มอบหมายให้กับผู้เขียนที่เจาะจง','Limit result set to posts with a specific menu_order value.'=>'จำกัดผลลัพท์ตั้งค่าไปที่เรื่องที่มีค่า menu_order ที่เจาะจง','Offset the result set by a specific number of items.'=>'ชดเชยชุดผลลัพธ์ด้วยจำนวนรายการที่กำหนด','Limit result set to items with particular parent IDs.'=>'ผลลัพท์จำกัดตั้งค่าไปที่เลขที่ไอดีหลักเฉพาะ','Limit result set to all items except those of a particular parent ID.'=>'จำกัดผลลัพธ์เป็นทั้งหมด ยกเว้นที่เป็นรายการที่อยู่ใต้ ID หลักที่กำหนด','Limit result set to items except those with specific terms assigned in the %s taxonomy.'=>'กำหนดให้มีการจำกัดผลลัพธ์กับรายการ ยกเว้นรายการที่มีคำศัพท์เฉพาะที่ถูกกำหนดในหมวดคำศัพท์ %s','Limit result set to items that are sticky.'=>'จำกัดชุดผลลัพท์ไปยังรายการที่เป็นปักหมุด','Invalid revision ID.'=>'เลขที่รุ่นไม่ถูกต้อง','The %s property has an invalid stored value, and cannot be updated to null.'=>'รูปแบบค่าของ %s ที่บันทึกไว้ไม่ถูกต้อง และไม่สามารถอัปเดตเป็นค่าเปล่าได้','Whether or not the term cloud should be displayed.'=>'ควรแสดงเงื่อนไขเสมอ','Limit results to taxonomies associated with a specific post type.'=>'จำกัดผลลัพธ์ให้กับแท็กโซโนมีที่ผูกกับโพสต์ไทป์ที่กำหนด','Required to be true, as users do not support trashing.'=>'ต้องเป็นจริง (true) เพราะผู้ใช้ไม่รองรับการลบลงถังขยะ','Unique identifier for the user.'=>'ตัวบ่งชี้เฉพาะสำหรับผู้ใช้','Number of published posts for the term.'=>'จำนวนของเรื่องที่เผยแพร