ue from database.'=>'ไม่สามารถลบค่า meta จากฐานข้อมูล','Meta fields.'=>'ฟิลด์ Meta','%1$s is not one of %2$s.'=>'%1$s ไม่ใช่หนึ่งใน %2$s','Item selected.'=>'รายการที่ถูกเลือก','Limit result set to posts with one or more specific slugs.'=>'ผลลัพท์จำกัดตั้งค่าไปที่เรื่องที่ระบุ 1 slug หรือมากกว่า','Taxonomies associated with post type.'=>'ลำดับขั้นที่ทำงานร่วมกับประเภทเรื่อง','Comment field exceeds maximum length allowed.'=>'ช่องความเห็นเกินกว่าความยาวสูงสุดที่อนุญาต','Limit result set to posts assigned one or more statuses.'=>'ผลลัพท์จำกัดตั้งค่าไปที่เรื่องที่ถูกมอบหมายกับหนึ่งสถานะหรือมากกว่า','Invalid JSON body passed.'=>'เนื้อหา JSON ไม่ถูกต้อง','The comment does not support trashing. Set \'%s\' to delete.'=>'ความเห็นไม่รองรับการลบ (Trashing) โปรดตั้งค่า \'%s\' เพื่อลบทิ้ง','The post does not support trashing. Set \'%s\' to delete.'=>'เรื่องไม่รองรับการลบ (Trashing) โปรดตั้งค่า \'%s\' เพื่อลบทิ้ง','Revisions do not support trashing. Set \'%s\' to delete.'=>'สำเนาการปรับปรุงไม่รองรับการลบ (Trashing) โปรดตั้งค่า \'%s\' เพื่อลบทิ้ง','Terms do not support trashing. Set \'%s\' to delete.'=>'เงื่อนไขไม่รองรับการลบ (Trashing) โปรดตั้งค่า \'%s\' เพื่อลบทิ้ง','Users do not support trashing. Set \'%s\' to delete.'=>'ผู้ใช้ไม่รองรับการลบ (Trashing) โปรดตั้งค่า \'%s\' เพื่อลบทิ้ง','Caption for the attachment, as it exists in the database.'=>'คำบรรยาย สำหรับไฟล์แนบ เท่าที่มีอยู่ในฐานข้อมูล','HTML caption for the attachment, transformed for display.'=>'แปลงคำบรรยายแบบ HTML ของไฟล์แนบให้แสดงผลได้','Description for the attachment, as it exists in the database.'=>'คำอธิบายสำหรับไฟล์แนบ ตามที่ปรากฎอยู่ในฐานข้อมูล','HTML description for the attachment, transformed for display.'=>'คำอธิบาย HTML สำหรับไฟล์แนบ ปรับแต่งสำหรับการแสดงผล','REST base route for the taxonomy.'=>'เส้นทางพื้นฐานของ REST สำหรับหมวดคำศัพท์','label for hide controls button without length constraintsHide Controls'=>'ซ่อนการควบคุม','label for hide controls button without length constraintsShow Controls'=>'แสดงการค