isplayed on those pages.'=>'คุณสามารถเข้าชมหน้าอื่นบนเวปไซท์ของคุณโดยที่สามารถใช้คัสโตไมเซอร์เพื่อชมและแก้ไขวิดเจ็ตที่แสดงบนหน้าเหล่านั้นไปพร้อมกันได้ ','Id should start with a letter, followed only by letters, numbers, dashes, dots, colons or underscores.'=>'ไอดีควรเริ่มต้นด้วยตัวอักษร และตามด้วยตัวอักษร ตัวเลข ขีดแดช จุด เครื่องหมายโคลอนหรือเครื่องหมายอันเดอร์สกอร์ ','Id for link anchor (TinyMCE)Id'=>'ไอดี','Date/time'=>'วัน/เวลา','Table of Contents'=>'สารบัญ','Insert/edit code sample'=>'แทรกหรือแก้ไขตัวอย่างโค้ด','Insert/edit media'=>'แทรกหรือแก้ไขสื่อ','Short for red in RGBR'=>'R','Short for green in RGBG'=>'G','Short for blue in RGBB'=>'B','The URL of the resource for which to fetch oEmbed data.'=>'URL ที่ต้องการใช้ถึงข้อมูล oEmbed','The oEmbed format to use.'=>'ฟอร์แมทของ oEmbed ที่จะใช้','The maximum width of the embed frame in pixels.'=>'ขนาดกว้างสุดของเฟรมในหน่วยพิกเซล','The maximum height of the embed frame in pixels.'=>'ขนาดสูงสุดของเฟรมในหน่วยพิกเซล','Whether to perform an oEmbed discovery request for unsanctioned providers.'=>'การอนุญาตให้ผู้ให้บริการที่ไม่ได้อยู่ในรายชื่อสามารถใช้งาน oEmbed ได้เสมอ','Sorry, you are not allowed to make proxied oEmbed requests.'=>'ขออภัย คุณไม่ได้รับอนุญาตให้ส่งคำขอ proxied oEmbed','%s item'=>'%s รายการ','View User'=>'ดูข้อมูลผู้ใช้','Edit User'=>'แก้ไขผู้ใช้','The previous set of changes has already been published. Please try saving your current set of changes again.'=>'การเปลี่ยนแปลงก่อนหน้านี้ได้รับการเผยแพร่แล้ว กรุณาบันทึกการเปลี่ยนแปลงปัจจุบันของคุณดูอีกครั้ง','You must supply a future date to schedule.'=>'คุณต้องระบุเป็นวันที่ล่วงหน้า เพื่อกำหนดวันเผยแพร่','Unable to save due to %s invalid setting.'=>'ไม่สามารถบันทึกข้อมูลได้ เนื่องจาก %s การตั้งค่าไม่ถูกต้อง','There was an authentication problem. Please reload and try again.'=>'พบปัญหาการยืนยันตัวตน กรุณาโหลดใหม่ และลองอีกครั้ง','No changes saved yet, so there is nothing to trash.'=>'ยังไม่ได้บันทึกการเปลี่ยนแปลงใด ๆ ดังนั้นจึงไม่มีอะไรที่ถังขยะ','Unable to trash changes.'=>'ไม่สามารถเปลี่ยนถังขยะได้','Changes have already been trashed.'=>'การเปลี่ยนแปลงถูกทิ้งลงในถังขยะแล้ว','Changes trashed successfully.'=>'เปลี่ยนถังขยะเรียบร้อยแล้ว','Share Preview Link'=>'แชร์ลิ้งก์ตัวอย่าง','See how changes would look live on your website, and share the preview with people who can\'t access the Customizer.'=>'ดูว่าหน้าตาเว็บไซต์ของคุณเปลี่ยนแปลงไปอย่างไร และแบ่งปันให้กับคนอื่นที่เข้าถึงตัวปรับแต่งไม่ได้ ให้สามารถดูตัวอย่างการแสดงผลนั้นได้ด้วย','Preview Link'=>'ลิงก์ตัวอย่าง','Copied'=>'คัดลอกแล้ว','Installed themes'=>'ติดตั้งธีมแล้ว','WordPress.org themes'=>'ธีม WordPress.org','Site Icons are what you see in browser tabs, bookmark bars, and within the WordPress mobile apps. Upload one here!'=>'คุณสามารถเห็นรูปไอคอนเว็บได้จากแถบของเบราว์เซอร์, แถบบุ๊กมาร์ค และในแอพลิเคชั่น WordPress บนมือถือ อัปโหลดรูปไอคอนเว็บของคุณได้ที่นี่!','Site Icons should be square and at least %s pixels.'=>'รูปไอคอนเว็บความเป็นสี่เหลี่ยมจัตุรัส และมีความกว้างอย่างน้อย %s พิกเซล','Homepage Settings'=>'ตั้งค่าหน้าแรก','You can choose what&#8217;s displayed on the homepage of your site. It can be posts in reverse chronological order (classic blog), or a fixed/static page. To set a static homepage, you first need to create two Pages. One will become the homepage, and the other will be where your posts are displayed.'=>'คุณสามารถเลือกได้ว่าจะแสดงสิ่งใดบ้างบนหน้าแรกของเว็บไซต์ มันอาจจะเป็นเรื่องต่างๆ ที่คุณเขียน เรียงลำดับตามการเผยแพร่ (บล็อกแบบดั้งเดิม) หรือเป็นหน้าตายตัว โดยก่อนจะการตั้งค่าหน้าแรกแบบตายตัว คุณจะต้องสร้างหน้า จำนวนสองหน้า หน้าหนึ่งเพื่อเป็นหน้าแรกของเว็บไซต์ และอีกหนึ่งหน้าสำหรับแสดงเรื่องของคุณ','Your homepage displays'=>'แสดงหน้าแรกของคุณด้วย','Add your own CSS code here to customize the appearance and layout of your site.'=>'เพิ่มโค้ด CSS ของคุณเองที่นี่เพื่อกำหนดรูปลักษณ์และเค้าโครงเว็บของคุณ','When using a keyboard to navigate:'=>'เมื่อใช้แป้นพิมพ์ในการใช้งาน:','In the editing area, the Tab key enters a tab character.'=>'เมื่ออยู่ในพื้นที่การแก้ไข การกดแป้น Tab ก็คือการป้อนตัวอักขระแท็บ ','To move away from this area, press the Esc key followed by the Tab key.'=>'เพื่อย้ายออกจากพื้นที่นี้ ให้กดแป้น Esc แล้วตามด้วยแป้น Tab','Screen reader users: when in forms mode, you may need to press the Esc key twice.'=>'สำหรับผู้ใช้งานการอ่านจอภาพ: เมื่ออยู่ในรูปแบบตาราง คุณอาจจะต้องกดแป้น Esc สองครั้ง','CSS code'=>'โค้ด CSS','Your theme can display menus in one location.'=>'ธีมของคุณสามารถแสดงเมนูได้ 1 ตำแหน่ง','Your theme can display menus in %s location.'=>'ธีมของคุณแสดงเมนูได้ %s ตำแหน่ง','If your theme has multiple menus, giving them clear names will help you manage them.'=>'ถ้าธีมที่คุณใช้งานมีเมนูจำนวนมาก การตั้งชื่อเมนูให้ชัดเจนจะช่วยให้คุณจัดการเมนูเหล่านั้นง่ายขึ้น','New Menu'=>'เมนูใหม่','Create New Menu'=>'สร้างเมนูใหม่','Name for the Visual editor tabVisual'=>'เสมือนจริง','The theme defines itself as its parent theme. Please check the %s header.'=>'ธีมได้กำหนดให้ธีมเป็นธีมหลัก โปรดตรวจสอบที่ส่วนหัวของ %s','The edit field automatically highlights code syntax. You can disable this in your <a href="%1$s" %2$s>user profile%3$s</a> to work in plain text mode.'=>'ฟิลด์ที่ทำการแก้ไขจะมีการเน้นโครงสร้างการเขียนโค้ดโดยอัตโนมัติ คุณสามารถปิดการใช้งานนี้ได้ที่ <a href="%1$s" %2$s>ข้อมูลส่วนตัวของคุณ%3$s</a> เพื่อที่จะทำงานในโหมดข้อความธรรมดา (Plain text) แทน','Usage of user levels is deprecated. Use capabilities instead.'=>'ระดับผู้ใช้ถูกยกเลิกการใช้งานแล้ว โปรดใช้เมนูความสามารถแทน','Your theme can display menus in one location. Select which menu you would like to use.'=>'ธีมของคุณสามารถแสดงเมนูได้ 1 ตำแหน่ง กรุณาเลือกเมนูที่คุณต้องการใช้งาน','menu locationsView Location'=>'ดูตำแหน่งเมนูทั้งหมด','Looking for a theme? You can search or browse the WordPress.org theme directory, install and preview themes, then activate them right here.'=>'กำลังมองหาธีมอยู่รึเปล่า? คุณสามารถหาหรือดูเพลินๆได้จาก ธีมไดเรกทอรีของ WordPress.org ติดตั้ง ดูตัวอย่างธีม และเปิดใช้งานธีมเหล่านั้นได้จากตรงนี้','While previewing a new theme, you can continue to tailor things like widgets and menus, and explore theme-specific options.'=>'ในขณะที่กำลังดูตัวอย่างธีม คุณสามารถปรับสิ่งอื่นๆเช่น วิดเจ็ต เมนู และตัวเลือกอื่นๆของธีม ตามความเหมาะสมต่อไปได้','menu locationsView All Locations'=>'ดูตำแหน่งเมนูทั้งหมด','It doesn&#8217;t look like your site has any menus yet. Want to build one? Click the button to start.'=>'ดูเหมือนว่าเว็บของคุณยังไม่มีเมนู คุณต้องการสร้างหรือไม่? กดที่ปุ่มเพื่อเริ่มต้นการสร้างเมนู','You&#8217;ll create a menu, assign it a location, and add menu items like links to pages and categories. If your theme has multiple menu areas, you might need to create more than one.'=>'คุณกำลังจะสร้างเมนู เลือกตำแหน่งที่ต้องการ และเพิ่มรายการของเมนู เช่น ลิงก์ของหน้า และลิงก์ของหมวดหมู่ ถ้าธีมของคุณมีเมนูได้หลายตำแหน่ง คุณอาจจะต้องสร้างมากกว่าหนึ่งเมนู','Changeset is being edited by other user.'=>'การแก้ไขกำลังแก้ไขโดยผู้ใช้รายอื่น','Security check failed.'=>'การตรวจสอบความปลอดภัยล้มเหลว','No changeset found to take over'=>'ไม่พบว่ามีการเปลี่ยนแปลงใด ๆ','Sorry, you are not allowed to take over.'=>'ขออภัย คุณไม่ได้รับอนุญาตให้เข้าควบคุม','%s is already customizing this site. Do you want to take over?'=>'%s กำลังปรับแต่งเว็บนี้อยู่ คุณต้องการเข้าใช้งานแทนหรือไม่?','%s is already customizing this site. Please wait until they are done to try customizing. Your latest changes have been autosaved.'=>'%s กำลังปรับแต่งเว็บนี้อยู่ กรุณารอจนกว่าพวกเค้าปรับแต่งเรียบร้อย การเปลี่ยนแปลงล่าสุดของคุณได้ถูกบันทึกอัตโนมัติแล้ว','Go back'=>'ย้อนกลับ','Take over'=>'เข้าแทนที่','Could not open handle for %1$s to %2$s.'=>'ไม่สามารถเปิดตัวจัดการสำหรับ %1$s ไปยัง %2$s ได้','customizer changeset action/button labelSchedule'=>'ตั้งเวลาล่วงหน้า','Click &#8220;Next&#8221; to start adding links to your new menu.'=>'กด &#8220;ถัดไป&#8221; เพื่อเริ่มการเพิ่มลิงก์ที่เมนูใหม่ของคุณ','Update anyway, even though it might break your site?'=>'ดำเนินการอัปเดต แม้ว่ามันอาจจะทำให้เว็บของคุณเสียหาย?','%s is already customizing this changeset. Please wait until they are done to try customizing. Your latest changes have been autosaved.'=>'%s กำลังปรับแต่งการเปลี่ยนแปลงนี้อยู่ โปรดรอจนกว่าเขาจะทำงานเสร็จสิ้น การเปลี่ยนแปลงล่าสุดของคุณได้รับการบันทึกอัตโนมัติแล้ว','%s is already customizing this changeset. Do you want to take over?'=>'%s กำลังปรับแต่งการเปลี่ยนแปลงนี้อยู่ คุณต้องการเข้าใช้งานแทนหรือไม่?','Something went wrong.'=>'มีบางอย่างผิดปรกติ','You need a higher level of permission.'=>'คุณต้องมีสิทธิ์ที่สูงกว่านี้','No archives to show.'=>'ไม่มีไฟล์เก่าเก็บให้แสดง','%1$s on %2$s'=>'%1$s บน %2$s','No comments to show.'=>'ไม่มีความเห็นที่จะแสดง','Block type names must be strings.'=>'ชื่อของประเภทบล็อกต้องเป็นประเภทสตริง','Block type names must not contain uppercase characters.'=>'ชื่อของประเภทบล็อกต้องไม่มีตัวพิมพ์ใหญ่','Block type names must contain a namespace prefix. Example: my-plugin/my-custom-block-type'=>'ชื่อประเภทบล็อกจะต้องมีชื่อนำหน้าเฉพาะ เช่น: my-plugin/my-custom-block-type','Block type "%s" is already registered.'=>'ประเภทบล็อก "%s" ถูกลงทะเบียนแล้ว','Block type "%s" is not registered.'=>'ประเภทบล็อก "%s" ยังไม่ถูกลงทะเบียน','(opens in a new tab)'=>'(เปิดในแท็บใหม่)','Classic Block Keyboard Shortcuts'=>'แป้นลัด Classic Block','A key value mismatch has been detected. Please follow the link provided in your activation email.'=>'ตรวจพบค่าของข้อมูลไม่ตรงกัน โปรดกดลิงก์ตามที่ส่งให้ทางอีเมลที่ใช้สมัคร และทำตามขั้นตอนต่อไป','A variable mismatch has been detected.'=>'ตรวจพบตัวแปรที่ไม่ตรงกัน','This theme failed to load properly and was paused within the admin backend.'=>'การทำงานของธีมถูกหยุดในส่วนผู้ดูแลเว็บไซต์ซึ่งเกิดจากข้อผิดพลาดในการเรียกใช้','Your comment is awaiting moderation. This is a preview; your comment will be visible after it has been approved.'=>'ความเห็นของคุณกำลังอยู่ระหว่างการพิจารณา นี่คือตัวอย่าง; ความเห็นของคุณจะปรากฏขึ้นหลังจากได้รับการอนุมัติ','Quote from Hello Dolly song, by Jerry Herman:'=>'อ้างอิงมาจากเพลง Hello Dolly โดย Jerry Herman','%s Comment in moderation'=>'%s ความเห็นรอตรวจสอบ','Exit Recovery Mode'=>'ออกจากโหมดการกู้คืน','https://developer.wordpress.org/themes/advanced-topics/child-themes/'=>'https://developer.wordpress.org/themes/advanced-topics/child-themes/','No cookie present.'=>'ไม่มีคุกกี้อยู่','Invalid cookie format.'=>'รูปแบบคุกกี้ไม่ถูกต้อง','Cookie expired.'=>'คุกกี้หมดอายุแล้ว','Invalid cookie.'=>'คุกกี้ไม่ถูกต้อง','Keep widget settings and move it to the inactive widgets'=>'เก็บการตั้งค่าวิดเจ็ตและย้ายไปยังวิดเจ็ตที่ไม่ได้ใช้งาน','User roleAdministrator'=>'ผู้ดูแล','User roleEditor'=>'ผู้ตรวจทาน','User roleAuthor'=>'ผู้เขียน','User roleContributor'=>'ผู้มีส่วนร่วม','User roleSubscriber'=>'ผู้รับข่าวสาร','Recovery Mode not initialized.'=>'โหมดการกู้คืนไม่ได้เริ่มต้น','Invalid recovery key format.'=>'รูปแบบคีย์การกู้คืนไม่ถูกต้อง','Invalid recovery key.'=>'คีย์การกู้คืนไม่ถูกต้อง','Recovery key expired.'=>'คีย์การกู้คืนหมดอายุ','Could not update the email last sent time.'=>'ไม่สามารถอัปเดตเวลาส่งอีเมลล่าสุดได้','The email could not be sent. Possible reason: your host may have disabled the %s function.'=>'ไม่สามารถส่งอีเมลได้ เหตุผลที่เป็นไปได้: โฮสต์ของคุณอาจจะปิดฟังก์ชัน %s ไว้','A recovery link was already sent %1$s ago. Please wait another %2$s before requesting a new email.'=>'ส่งลิงก์เพื่อกู้คืนแล้วเมื่อ %1$s ที่แล้ว กรุณารอ %2$s ก่อนส่งอีเมลคำขอใหม่','Error Details'=>'รายละเอียด​ข้อผิดพลาด​','[%s] Your Site is Experiencing a Technical Issue'=>'[%s] เกิดข้อผิดพลาดขึ้นกับเว็บไซต์ของคุณ','Error not caused by a plugin or theme.'=>'ข้อผิดพลาดไม่ได้เกิดขึ้นจากปลั๊กอินหรือธีม','Failed to store the error.'=>'ไม่สามารถจัดเก็บความผิดพลาดได้','Exit recovery mode link expired.'=>'ลิงก์สำหรับออกจากโหมดกู้คืนหมดอายุ','Failed to exit recovery mode. Please try again later.'=>'เกิดข้อผิดพลาดในการออกจากโหมดการกู้คืน โปรดลองใหม่อีกครั้ง','Support'=>'สนับสนุน','https://wordpress.org/support/forums/'=>'https://th.wordpress.org/support/forums/','Error occurred on a non-protected endpoint.'=>'เกิดความผิดพลาดกับเนื้อหาปลายทางที่ไม่ได้รับการป้องกัน','Please contact your host for assistance with investigating this issue further.'=>'กรุณาติดต่อผู้ดูแลระบบของท่านเพื่อตรวจสอบลงรายละเอียดของความผิดพลาดที่เกิดขึ้น','In this case, WordPress caught an error with one of your plugins, %s.'=>'WordPress ตรวจพบความผิดปรกติในปลั๊กอิน %s ของท่าน','In this case, WordPress caught an error with your theme, %s.'=>'WordPress ตรวจพบความผิดปรกติในธีม %s ของท่าน','Howdy!

Since WordPress 5.2 there is a built-in feature that detects when a plugin or theme causes a fatal error on your site, and notifies you with this automated email.
###CAUSE###
First, visit your website (###SITEURL###) and check for any visible issues. Next, visit the page where the error was caught (###PAGEURL###) and check for any visible issues.

###SUPPORT###

If your site appears broken and you can\'t access your dashboard normally, WordPress now has a special "recovery mode". This lets you safely login to your dashboard and investigate further.

###LINK###

To keep your site safe, this link will expire in ###EXPIRES###. Don\'t worry about that, though: a new link will be emailed to you if the error occurs again after it expires.

When seeking help with this issue, you may be asked for some of the following information:
###DEBUG###

###DETAILS###'=>'สวัสดี!

ตั้งแต่ WordPress รุ่น 5.2 มีคุณสมบัติพิเศษมาพร้อมสำหรับตรวจสอบ เมื่อปลั๊กอินหรือธีมทำให้เกิดข้อผิดพลาดอย่างรุนแรงบนเว็บของคุณ และจะแจ้งเตือนคุณทางอีเมลอัตโนมัตินี้
###CAUSE###
สิ่งแรก เข้าไปดูเว็บของคุณ (###SITEURL###) และตรวจสอบปัญหาที่แสดงให้เห็น ถัดไป เข้าไปดูหน้าที่เกิดข้อผิดพลาดขึ้น (###PAGEURL###) และตรวจสอบว่ามีปัญหาอะไรเกิดขึ้นบ้าง

###SUPPORT###

ถ้าเว็บของคุณแสดงผลไม่ถูกต้องและคุณไม่สามารถเข้าถึงแผงควบคุมได้อย่างปกติ WordPress ตอนนี้มี "โหมดการกู้คืน" เพิ่มเติมขึ้นมา ทำให้คุณสามารถเข้าสู่ระบบอย่างปลอดภัยไปยังแผงควบคุมและตรวจสอบเพิ่มเติมได้

###LINK###

เพื่อการรักษาความปลอดภัยในเว็บของคุณ ลิงก์นี้จะหมดอายุใน ###EXPIRES### อย่ากังวลเกี่ยวกับมัน ลิงก์ใหม่จะถูกส่งอีเมลถึงคุณถ้ามีข้อผิดพลาดเกิดขึ้นอีกหลังจากมันหมดอายุ

เมื่อร้องขอความช่วยเหลือเกี่ยวกับปัญหานี้ คุณอาจจะถูกถามถึงข้อมูลบางอย่างดังนี้:
###DEBUG###

###DETAILS###','Allow people to submit comments on new posts.'=>'อนุญาตให้ผู้อื่นแสดงความเห็นในเรื่องที่ถูกสร้างขึ้นใหม่','Cannot resize the image. Both width and height are not set.'=>'ไม่สามารถเปลี่ยนขนาดรูปภาพได้ ไม่ได้มีการกำหนดทั้งความกว้างและความสูงไว้','Original SizeOriginal'=>'ดั้งเดิม','Your site doesn&#8217;t have any %s, so there&#8217;s nothing to display here at the moment.'=>'เว็บของคุณไม่มี %s แต่อย่างใด ดังนั้นแล้วก็จะไม่มีอะไรแสดงออกมา ณ ตอนนี้','Added:'=>'เพิ่มขึ้นมา:','Unchanged:'=>'ไม่เปลี่ยน:','The image cannot be rotated because the embedded meta data cannot be updated.'=>'รูปภาพไม่สามารถหมุนได้เนื่องจากคำอธิบายที่ฝังไว้ไม่สามารถแก้ไขได้','There has been a critical error on this website, putting it in recovery mode. Please check the Themes and Plugins screens for more details. If you just installed or updated a theme or plugin, check the relevant page for that first.'=>'เกิดข้อผิดพลาดร้ายแรงขึ้นบนเว็บไซต์นี้ ทำให้มันถูกนำเข้าไปยังโหมดกู้คืน โปรดตรวจสอบหน้าจอธีมและปลั๊กอินสำหรับรายละเอียดเพิ่มเติม หากคุณเพิ่งจะติดตั้งหรืออัปเดตธีมหรือปลั๊กอิน ให้ตรวจสอบที่หน้านั้นก่อน','There has been a critical error on this website. Please check your site admin email inbox for instructions.'=>'เกิดข้อผิดพลาดร้ายแรงขึ้นบนเว็บนี้ โปรดตรวจสอบคำแนะนำในกล่องข้อความในอีเมลของผู้ดูแลเว็บ','There has been a critical error on this website.'=>'เกิดข้อผิดพลาดร้ายแรงบนเว็บไซต์นี้','Block name must be a string.'=>'ชื่อบล็อกต้องเป็นตัวอักขระ','Block style name must be a string.'=>'ชื่อสไตล์ของบล๊อกต้องเป็นสตริง','Block "%1$s" does not contain a style named "%2$s".'=>'บล็อก "%1$s" ไม่มีสไตล์ชื่อว่า "%2$s"','WordPress version %s'=>'WordPress เวอร์ชั่น %s','Current theme: %1$s (version %2$s)'=>'ธีมปัจจุบัน: %1$s (รุ่น %2$s)','Current plugin: %1$s (version %2$s)'=>'ปลั๊กอินปัจจุบัน: %1$s (รุ่น %2$s)','PHP version %s'=>'PHP เวอร์ชั่น %s','Sorry, the post could not be created.'=>'ขออภัย ไม่สามารถสร้างเรื่องได้','Sorry, this method is not supported.'=>'ขออภัย ทฤษฎีนี้ไม่ได้รับการรับรอง','The post status %1$s is not registered, so it may not be reliable to check the capability "%2$s" against a post with that status.'=>'สถานะเรื่อง %1$s ไม่ได้ถูกลงทะเบียน เพราะฉะนั้นจึงไม่น่าเชื่อถือที่จะตรวจสอบสมรรถนะ "%2$s" ของเรื่องด้วยสถานะนั้น','Sorry, the post could not be updated.'=>'ขออภับ ไม่สามารถแก้ไขเรื่องได้','Sorry, the post could not be deleted.'=>'ขออภัย ไม่สามารถลบเรื่องได้','Sorry, the category could not be created.'=>'ขออภัย ไม่สามารถสร้างหมวดหมู่ได้','Edit Profile'=>'แก้ไขโปรไฟล์','Pattern "%s" not found.'=>'ไม่พบแพตเทิร์น "%s"','Block pattern categoryButtons'=>'ปุ่ม','Block pattern categoryColumns'=>'คอลัมน์','Block pattern categoryGallery'=>'แกลเลอรี','Block pattern categoryHeaders'=>'ส่วนหัว','Block pattern categoryText'=>'ข้อความ','Embed Handler'=>'Embed Handler','by %s'=>'โดย %s','Sorry, you are not allowed to comment on this post.'=>'ขออภัย คุณไม่ได้รับอนุญาตให้แสดงความเห็นบนเรื่องนี้','An application name is required to create an application password.'=>'ต้องกรอกชื่อแอปพลิเคชันเพื่อสร้างรหัสผ่านของแอปพลิเคชัน','Could not save application password.'=>'ไม่สามารถบันทึกรหัสผ่านของแอปพลิเคชัน','Could not find an application password with that id.'=>'ไม่พบรหัสผ่านของแอปพลิเคชันจาก ID นี้ ','Could not delete application password.'=>'ไม่สามารถลบรหัสผ่านของแอปพลิเคชัน ','This content is password protected.'=>'เนื้อหานี้ถูกป้องกันด้วยรหัสผ่าน','%s update available'=>'มี %s อัปเดตออกมาแล้ว','block categoryText'=>'ข้อความ','block categoryWidgets'=>'วิดเจ็ต','block categoryTheme'=>'ธีม','block categoryEmbeds'=>'ฝัง','block categoryReusable Blocks'=>'บล็อกที่ใช้ซ้ำได้','Block pattern titleGrid'=>'ตาราง','Block pattern titleLarge title'=>'ชื่อขนาดใหญ่','Block pattern titleImage at left'=>'รูปภาพด้านซ้าย','Block pattern titleOffset'=>'ชดเชย','Block pattern titleSmall image and title'=>'รูปภาพขนาดเล็กและชื่อ','Block pattern titleStandard'=>'มาตรฐาน','Block pattern titleSocial links with a shared background color'=>'ลิงก์โซเชียลด้วยสีพื้นที่ถูกแบ่งปันต่อๆ กันมา','No theme is defined for this template.'=>'ไม่มีธีมที่กำหนดให้ใช้สำหรับเทมเพลตนี้','Empty template: %s'=>'เทมเพลตเปล่า: %s','No matching template found.'=>'ไม่พบเทมเพลตที่ตรงกัน','No matching template found'=>'ไม่พบเทมเพลตที่ตรงกัน','(Home link, opens in a new tab)'=>'เปิดลิงก์ไปหน้าหลักบนแท็บใหม่','Site logo.'=>'โลโก้เว็บ','%1$s: %2$s'=>'%1$s: %2$s','Block pattern categoryQuery'=>'Query','If your theme has widget areas, you can also add menus there. Visit the <a href="%s">Widgets panel</a> and add a &#8220;Navigation Menu widget&#8221; to display a menu in a sidebar or footer.'=>'ถ้าธีมของคุณมีพื้นที่สำหรับวิดเจ็ต คุณสามารถเพิ่มเมนูไว้ที่นั่นได้ด้วย ไปที่ <a href="%s">แถบวิดเจ็ต</a> และกด &#8220;วิดเจ็ตเมนูแนะแนว&#8221; เพื่อแสดงเมนูที่แถบด้านข้าง หรือส่วนท้ายของเว็บ','Menus can be displayed in locations defined by your theme or in <a href="%s">widget areas</a> by adding a &#8220;Navigation Menu&#8221; widget.'=>'เมนูสามารถแสดงในที่อยู่ที่กำหนดโดยธีมของคุณหรือใน <a href="%s">พื้นที่วิดเจ็ต</a> โดยการเพิ่มวิดเจ็ต &#8220;เมนูแนะแนว&#8221; ','This panel is used for managing navigation menus for content you have already published on your site. You can create menus and add items for existing content such as pages, posts, categories, tags, formats, or custom links.'=>'ส่วนควบคุมนี้ใช้สำหรับจัดการเมนูแนะแนวสำหรับเนื้อหาที่คุณได้เผยแพร่บนเว็บของคุณแล้ว คุณสามารถสร้างเมนูและเพิ่มรายการสำหรับเนื้อหาที่มีอยู่แล้ว เช่น หน้า เรื่อง หมวดหมู่ ป้ายกำกับ รูปแบบหรือลิงก์กำหนดเอง']];